import {useState} from 'react';




const HomePage = () => {
    const [data, setData] = useState([]);

    fetch("https://corona.lmao.ninja/all")
        .then(data => data.json())
        .then(users => {
            setData(data)
        })
        .catch(error => {
            console.log(error)
        })

    return (
        <>
        {
            data.map((item) => {
                console.log(item)
            })
        }
        </>
    );
}

export default HomePage
